import React, { Fragment } from 'react';

import Header from '../Header';
import Proclaim from '../../assets/graphics/proclaim@2x (1).jpg';
import JoinUs from '../../assets/graphics/join-service@2x (1).jpg';
import BYG from '../../assets/graphics/BYG@2x.jpg';
import { Container, Row, Col, Image } from 'react-bootstrap';
import './style.css';

const Home = () => {
  return (
    <Fragment>
      <Container id='home-body'>
        <Row className='justify-content-md-center'>
          <Image
            id='proclaim'
            src={Proclaim}
            alt='Pastor Joel proclaiming the name of Jesus'
          />
        </Row>
        <Row id='home-border' />
        <Row className='justify-content-md-center'>
          <Image id='byg' src={BYG} alt='Behold Your God Bible Study' />
        </Row>
      </Container>
    </Fragment>
  );
};

export default Home;

